import { Button, ButtonGroup } from "@mui/material";
import DeleteIcon from '@mui/icons-material/Delete';

import "./Dashboard.css";

const missions = [
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
  {
    name: "Please research the current state of the Bitcoin market and identify any...",
    status: "Completed",
    createdAt: "4/29/2023"
  },
]

const Dashboard = () => {
  return (
    <div className="multi-select">
      <div className="nav">
        <h1 className="personal-cia">Personal CIA</h1>
        <Button
          variant="contained"
          color="success"
        >
          + New Session
        </Button>
      </div>

      <div className="nav">
        <ButtonGroup color="primary" variant="outlined" aria-label="outlined button group">
          <Button>All</Button>
          <Button>Completed</Button>
          <Button>Searching</Button>
          <Button>Failed</Button>
        </ButtonGroup>

        <Button
          variant="contained"
          color="info"
        >
          Summarize
        </Button>
      </div>
      
      <table className="mission-table">
        <thead>
          <tr>
            <th></th>
            <th>Name</th>
            <th>Status</th>
            <th>Created Date</th>
            <th></th>
          </tr>
        </thead>

        <tbody>
          {missions.map((mission, idx) => {
            return (
              <tr key={idx}>
                <td></td>
                <td>{mission.name}</td>
                <td style={
                  { color: mission.status === "Completed" ? "green" : mission.status === "Failed" ? "red" : "" }
                }>
                  {mission.status}
                </td>
                <td>{mission.createdAt}</td>
                <td><DeleteIcon /></td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
